import React,{ useEffect, useState } from 'react';


const Counter = (props)=> {
    const [count,setCount] = useState(0);

    const increment=()=>{
      setCount(count+1);
    }
    
    const clickString =props.click || "Click Default";
    return (
        <button onClick={increment}>  {clickString} {count}</button>
    );
  
}
export default Counter;
